import React from 'react';
import Link from 'next/link'


const Navigation = () => {
    return(
        <>
            <ul> 
                <li>
                    <Link href='/'><a>Home</a></Link>
                </li>
                <li>
                    <Link href='/character'><a>Personajes</a></Link>
                </li>
            </ul>
                       
            <style jsx>{`
                ul{
                    width: 100%;
                    height: 2em;
                    display: flex;
                    background: yellow;
                    align-items:center;
                }
                li{
                    display: inline-block;
                    margin-left: 3em;
                }
            
            `}</style>
        </>
    )
}
export default Navigation;
